import { Nav } from "../styles/layout/Nav.styled";

export const NavBar = () => {
  return (
    <>
      <Nav>
        <div>Logo</div>
        <div>Menu Icon</div>
        <div>Nav List</div>
      </Nav>
    </>
  );
};
